import React, { useEffect, useState } from 'react'
import Layouts from '../../Layouts/Layouts'
import { useLoginManager } from '../../StateManagement/UserManagement';
import { useNavigate } from 'react-router-dom';
import img from './../../assests/images/Icons/maths';
function ProjectToGuide() {
    const{userID} = useLoginManager();
    const navigate = useNavigate();
    const [datas,setData] = useState();

    useEffect(()=>{
      const getData = async()=>{
        try{
            const response  = axios.get(`http://localhost:3001/t/guideProjects/${userID}`);
            setData(response.data);
        }
        catch(error)
        {  
            console.log(error);
        }
      }
      getData();
    },[])
  return (
    <Layouts>
        {datas.map((data,index)=>(
            <>
            <div>
                <img src={img}  />
                <p>{data.ProjectID}</p>
            </div>
            </>
        ))}
    </Layouts>
  )
}

export default ProjectToGuide
